Had a great time on set of @uniandtheurchins Dorian Grey music video!!!! 

@charolettekempmuhl #repost ᴅᴏʀɪᴀɴ ɢʀᴀʏ ɪꜱ ᴏᴜᴛ! ɢᴏ ᴡᴀᴛᴄʜ ᴏᴜʀ ᴡᴀʀʜᴏʟ ʟᴀꜱᴛ ꜱᴜᴘᴘᴇʀ ᴏɴ ʜɪɢʜ ᴛɪᴍᴇꜱ ᴀɴᴅ ʀᴇᴀᴅ ᴏᴜʀ ɪɴᴛᴇʀᴠɪᴇᴡ ᴡʜᴇʀᴇ ᴡᴇ ꜱᴏᴜɴᴅ ʟɪᴋᴇ ʙᴏᴏᴍᴇʀꜱ ʀᴀɴᴛɪɴɢ ᴀʙᴏᴜᴛ ᴍᴏᴅᴇʀɴ ᴛᴇᴄʜɴᴏʟᴏɢʏ, ʟᴏʟ 

ᴅɪʀᴇᴄᴛᴇᴅ/ ᴇᴅɪᴛᴇᴅ ʙʏ Charolette Kemp Muhl ꜱᴛᴀʀʀɪɴɢ ᴊᴀᴄᴋ ᴊᴀᴍᴇꜱ ᴀɴᴅ ᴀ ᴡʜᴏʟᴇ ᴄᴀꜱᴛ ᴏꜰ ᴀᴍᴀᴢɪɴɢ ᴀʟɪᴇɴꜱ
